import React, { useState } from 'react';
import Tab from './Tab';
import ToggleButton from './ToogleButton';
import { ITabListProps } from '../types/types';

const TabList = (props: ITabListProps) => {

    const [toggleValue, setToggleValue] = useState(false);

    function onToggleChange() {
        setToggleValue(!toggleValue)
    }

    return (
        <>
            <Tab
                id='home'
                header='Home'
                faIcon='fa fa-bars'
            >
                <p>This is Home.</p>
            </Tab>
            <Tab
                id='database'
                header='Database'
                faIcon='fa fa-database'
            >
                <ToggleButton
                    id='toggleLayer1'
                    isOn={toggleValue}
                    isOnColor='rgba(55,156,214,1)'
                    handleToggle={onToggleChange}
                    layerName='FlÃ¼sse'
                />
                <ToggleButton
                    id='toggleLayer2'
                    isOn={toggleValue}
                    isOnColor='rgba(55,156,214,1)'
                    handleToggle={onToggleChange}
                />
                <ToggleButton
                    id='toggleLayer3'
                    isOn={toggleValue}
                    isOnColor='rgba(55,156,214,1)'
                    handleToggle={onToggleChange}
                />
            </Tab>
            <Tab
                id='settings'
                header='Settings'
                faIcon='fa fa-cogs'
                disabled={true}
                anchor='bottom' />
            <Tab
                id='off'
                header='PowerOff'
                faIcon='fa fa-power-off'
                anchor='bottom' />
        </>
    )
}

export default TabList;
